Удобное приложение для покупки электронных билетов на мероприятия в Приднестровье.
Теперь не надо заранее ездить за билетами!
Выбирайте лучшие места и покупайте билеты со своего смартфона в любое время суток. Концерты, кинопремьеры, театральные спектакли, развлечения для детей, спортивные мероприятия, обучающие тренинги – все самые интересные события в одном приложении.  

Оплата происходит в рублях ПМР по реквизитам карты «Радуга».

Достоинства приложения «Билет ПМР»:
∙             быстрая авторизация через социальные сети;
∙             сохранение реквизитов платежной карты;
∙             подробное описание событий, трейлеры к кинопремьерам;
∙             сохранение билетов в Wallet.

1) Lights can recognize your usual color choices as you operate;
2) Lights can change color with beautiful music rhythm;
3) With timers switch, can be setting lights turn on off on time;
4) Selection of scenario modes with multiple colors;
5) A shake of the mobile phone can change the color of the light;
6) The color change of light can be controlled by sound;
7) The distance of remote control without direction limitation can reach more than 15 meters;
8) Lights can be changed from the photo on the mobile.

IDC Travel - это идеальное решение для тех, кто путешествует и хочет всегда оставаться на связи! Это сервис, который предоставляет вам связь и решает проблему высоких счетов за роуминг!

IDC Travel:
Предоставляет альтернативный доступ к услугам связи посредством любой сети передачи данных;
Позволяет звонить всем абонентам вне зависимости, установлено у них приложение или нет;
Позволяет использовать свой обычный номер IDC во время путешествий - с приложением больше не надо менять СИМ-карты.

Больше никаких сумасшедших счетов за роуминг - наслаждайтесь связью, где бы вы ни были!

Как это работает:
Установите приложение IDC Travel;
Зарегистрируйтесь в приложении – для этого введите свой номер IDC;
Далее следуйте инструкциям в приложении.
Обратите внимание! Зарегистрироваться в приложении нужно в домашней сети IDC!
